import React from 'react';
import style from './styles';
import {View,Text,StyleSheet} from 'react-native';
export default function MenuTab(props){
    return(
        <View> style={style.tabMenu}
        {
            props.items.map((item,index)=><Text style={index==0?
                [style.tabMenuItems,{backgroundColor:'grey'}]:style.tabMenuItems}
                 onPress = {props.onclick(index)}
                >{item.lable}</Text>)
        }
        </View>
    );
}
